def calculate_average_visitors(n, guest_sizes, table_length):
    dp = [[[0 for k in range(n + 1)] for i in range(table_length + 1)] for i in range(n + 1)]
    for j in range(table_length + 1):
        for k in range(n + 1):
            dp[0][j][k] = 1
    for i in range(1, n + 1):
        for j in range(table_length + 1):
            for k in range(1, n + 1):
                if j >= guest_sizes[k - 1]:
                    dp[i][j][k] = dp[i][j][k - 1] + i * dp[i - 1][j - guest_sizes[k - 1]][k - 1]
                else:
                    dp[i][j][k] = dp[i][j][k - 1]
    fact = n
    ans = 1
    for i in range(1, n + 1):
        ans += dp[i][table_length][n] / fact
        fact *= n - i
    return ans

